import React, {
  useState,
  useEffect
} from "react";
import ReactDOM from "react-dom";
import "./index.css";

function AdData() {
  const [data, setData] = useState(null);
  useEffect(() => {
    // fetch(`https://api.github.com/users/facebook`)
   fetch(`https://jf-na-cdn.justfab.com/image/site/en_US/dm/acquisition/feed/justfab/topconvert/jsonTest.json`)
    // fetch(`https://api.smartly.io/stats/v2/view/29457?token=04b9d710079c0227dfc0f6924f98c80d&timeframe=last_7_days&timezone=America/Los_Angeles&format=json`)
      .then(res => res.json())
      // .then(json => console.log(json))
      .then(setData)
      .catch(console.error);
  }, []);

  if (data) {
    return (
      <div>
     <h1>{data[2],[0]}</h1>
      {/* <h1>{data[2]}</h1> */}
        {/* <img src={data.avatar_url} width={100} /> */}

      </div>
    );
  }
  return null;
}

function App() {
  return <AdData/>;
}

ReactDOM.render(
  <App />,
  document.getElementById("root")
);
